<!-- Shader definition -->
<script id="shader_vs" type="notjs">#version 300 es

    in vec3 vertex;
	in vec2 uv;

    out vec2 texCoords;
	out float height;

    uniform mat4 viewMatrix;
    uniform mat4 projMatrix;
	uniform vec3 v_cam_pos;

    void main(){
        vec3 v = vertex - v_cam_pos;
        
        gl_Position = projMatrix * viewMatrix * vec4(v, 1.0);

        texCoords = uv;
		height = vertex.y;
    }
</script>
<script id="shader_fs" type="notjs">#version 300 es

    precision highp float;

    in vec2 texCoords;
	in float height;

    out vec4 fragColor;

	uniform sampler2D tex_diffuse;
	uniform float f_hollow_height;
	uniform float f_hollow_prop;

	float rand(vec2 co){
		return fract(sin(dot(co.xy ,vec2(12.9898,78.233))) * 43758.5453);
	}

	float noise(vec2 n) {
		const vec2 d = vec2(0.0, 1.0);
		vec2 b = floor(n), f = smoothstep(vec2(0.0), vec2(1.0), fract(n));
		return mix(mix(rand(b), rand(b + d.yx), f.x), mix(rand(b + d.xy), rand(b + d.yy), f.x), f.y);
	}

    void main(){
		float p = noise(texCoords * 256.0);
		//if(height > 1.0 && p < f_hollow_prop)
		if(height > f_hollow_height)
			discard;

		vec4 color = texture(tex_diffuse, texCoords);

	    fragColor = vec4(color.xyz, 1.0);
    }
</script>
<script id="shader_vs_poi" type="notjs">#version 300 es

    in vec2 vertex;

    out vec2 texCoords;

    uniform mat4 viewMatrix;
    uniform mat4 projMatrix;
	uniform vec3 v_cam_pos;

	uniform vec3 v_position;

    void main(){  
		vec3 v = -v_cam_pos + v_position;

        gl_Position = projMatrix * (viewMatrix * vec4(v, 1.0) + vec4(vertex * 0.5, 0.0, 0.0));

        texCoords = vertex*0.5+0.5;
    }
</script>
<script id="shader_fs_poi" type="notjs">#version 300 es

    precision highp float;

    in vec2 texCoords;

    out vec4 fragColor;

	uniform sampler2D tex_diffuse;
	uniform vec3 v_color_mul;

    void main(){
		float color = texture(tex_diffuse, texCoords).x;

	    fragColor = vec4(color * v_color_mul, color);
    }
</script>

<script id="shader_fs_rm" type="notjs">#version 300 es

precision highp float;

in vec2 texCoords;

out vec4 fragColor;

uniform mat4 invVP;
uniform float f_ar;

#define MAX_SAMPLES 16
#define EPSILON 0.01

#define SUN_DIR normalize(vec3(1.0, -1.0, -1.0))

//SDF Intersection functions by iq https://www.iquilezles.org/www/articles/distfunctions/distfunctions.htm
float sdBox( vec3 p, vec3 b )
{
  vec3 q = abs(p) - b;
  return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0);
}
float sdRoundBox( vec3 p, vec3 b, float r )
{
  vec3 q = abs(p) - b;
  return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0) - r;
}
//-------------------------

float calcDist(vec3 p){
	return min(sdRoundBox(vec3(0.0, -0.5, -0.5) - p, vec3(0.1, 0.1, 0.1), 0.05), sdBox(vec3(0.0, -1.0, 0.0) - p, vec3(4.0, 0.5, 4.0)));
}

//Used by iq https://www.shadertoy.com/view/Xds3zN
vec3 calcNormal(vec3 pos){
    vec3 n = vec3(0.0);
    for( int i=0; i<4; ++i )
    {
        vec3 e = 0.5773*(2.0*vec3((((i+3)>>1)&1),((i>>1)&1),(i&1))-1.0);
        n += e*calcDist(pos+0.0005*e);
    }
    return normalize(n);
}

vec3 calcLighting(vec3 p){
	vec3 n = calcNormal(p);

	//Simple lambert diffuse
	float ndotL = max(dot(n, -SUN_DIR), 0.0);

	return vec3(1.0) * ndotL;
}

vec3 raymarch(vec3 ro, vec3 rd){
	vec3 p = ro;
	float dist = calcDist(p);

	for(int i=0; i<MAX_SAMPLES; ++i){
		p += rd * dist;

		dist = calcDist(p);
		if(dist < EPSILON){
			return calcLighting(p);
		}
	}

	return vec3(0.0, 0.5, 1.0);
}

void main(){
	vec2 uc = 2.0 * texCoords - 1.0;

	vec3 ro = vec3(0.0);
	vec3 rd = (invVP * vec4(normalize(vec3(uc * vec2(1.0, f_ar), -1.0)), 1.0)).xyz;
	rd = vec3(-rd.x, -rd.z, -rd.y);

	vec3 color = raymarch(ro, rd);

	fragColor = vec4(color, 1.0);
}
</script>
